import React from 'react';
import Cards from './Cards';
import Sdata from './Sdata';


const App=()=>9
Sdata.map((val) => {
    return ( <
        Cards imgsrc = {
            val.imgsrc
        }
        title = {
            val.title
        }
        sname = {
            val.sname
        }
        link = {
            val.link
        }
        key = {
            val.id
        }
        />
    );
})
export default App;
